import {Routes, Route} from 'react-router-dom'
import Home from './elem/Home_page';
import Admin from './elem/Admin_page';

function App() {
  return (
    // <div className="App">
    //     Test
    // </div>

    <Routes>
      <Route path='/' element={<Home/>}/>
      <Route path='/admin' element={<Admin/>}/>
    </Routes>
  );
}

export default App;
